import logo from './logo.svg';
import './App.css';
import React from 'react';
import WeatherApp from './components/WeatherApp';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <WeatherApp />
      </header>
    </div>
  );
}

export default App;
